 `;

const Content = styled.div`
  width: 50%;
  border: solid red;
  display: flex;
`;

const TryIt = styled.button`
  background-color : #6055a5;
  color: white;
`;


function App() {
  return (
    <div className='App'>
      <Wrapper>
        <Text />
        <Content>

        </Content>
      </Wrapper>
    </div>
  );
}

export default App;
